import React, { createElement } from "react";

class Rocket extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            style: {
                opacity: 0
            }
        }
    }

    render() {
        return <div style={this.state.style}>ROCKET</div>
    }

    launch() {
        this.setState({style: {opacity: 1}})
    }
}

export default Rocket;
